 ('574', '493', 'en_us', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h3 class=\"block-headline\">The Story</h3>\n<p>Clean &amp; Clear looked to Snapchat to help raise awareness of its Morning Burst facial cleanser among females age 13 to 24. Clean &amp; Clear wanted to create ads in a few different formats to engage Snapchatters in a variety of ways — a video ad to tell a story in motion, a written segment to offer tips, and an interactive ad that would inspire viewers to get creative. </p>\n<p><br /></p>', NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-14 23:42:30', '2017-09-18 16:48:58', '09046bf5-dcfe-4c34-8853-1c1cd123ba79'),
