 ('578', '498', 'en_us', NULL, NULL, 'left', '<p>Clean &amp; Clear launched its Filters over high schools and college campuses to give its audience a way to frame their selfies and send them to friends. Sparkling bubbles and the positive message “Face so Fresh” resonated well with Snapchatters. Additionally, the creative’s Clean &amp; Clear logo helped increase Brand Awareness among Snapchatters who both used or received the Filter. <a href=\"http://geofilters.snapchat.com\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Filter.</a></p>', NULL, 'Filter', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-14 23:42:30', '2017-09-18 16:48:58', '1782d2e8-2e5f-4587-b676-341da93d90e5'),
