 ('688', '569', 'en_us', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h3 class=\"block-headline\">The Story</h3>\n<p>Now That’s What I Call Music! turned to Snapchat when it looked to promote its 61st edition of the iconic Now! series. Now! hoped to do so with a creative execution that could let listeners immediately access Now 61 across popular mobile music streaming services. Featuring hits from artists like Bruno Mars, Ariana Grande, Kendrick Lamar, The Weeknd and more, Now 61 was ready to turn it up.</p>', NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:12:22', '2017-09-15 21:42:19', 'a740d37b-74f9-4237-9be3-8ab424b2f009'),
 ('689', '569', 'de_de', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h3 class=\"block-headline\">The Story</h3>\n<p>Now That’s What I Call Music! turned to Snapchat when it looked to promote its 61st edition of the iconic Now! series. Now! hoped to do so with a creative execution that could let listeners immediately access Now 61 across popular mobile music streaming services. Featuring hits from artists like Bruno Mars, Ariana Grande, Kendrick Lamar, The Weeknd and more, Now 61 was ready to turn it up.</p>', NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:12:22', '2017-09-15 21:42:19', '06a4fba0-4477-4b57-8e90-0ca49ccd073e'),
