 ('692', '573', 'en_us', NULL, NULL, 'left', '<p>Now! partnered with Snapchat to take part in one of the platform’s first deep-link Snap Ads Web View executions. To grab Snapchatters’ attentions, Now! created full-screen, vertical video Top Snaps which prominently featured Now 61’s music and roster of pop stars. Snapchatters could then swipe up to access a list of music streaming services which, when tapped on, took them directly to the album in their streaming service of choice. <a href=\"https://snappublisher.snapchat.com/welcome\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Snap Ad.</a></p>', NULL, ' Snap Ads Web View', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:12:22', '2017-09-15 21:42:19', 'ebdf9ec8-e3ce-4ac5-9cb1-0f1c86205994'),
 ('693', '573', 'de_de', NULL, NULL, 'left', '<p>Now! partnered with Snapchat to take part in one of the platform’s first deep-link Snap Ads Web View executions. To grab Snapchatters’ attentions, Now! created full-screen, vertical video Top Snaps which prominently featured Now 61’s music and roster of pop stars. Snapchatters could then swipe up to access a list of music streaming services which, when tapped on, took them directly to the album in their streaming service of choice. <a href=\"https://snappublisher.snapchat.com/welcome\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Snap Ad.</a></p>', NULL, ' Snap Ads Web View', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:12:22', '2017-09-15 21:42:19', '32895fab-97f2-485b-b8e4-d4f29d340f70'),
