 ('718', '599', 'en_us', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h3 class=\"block-headline\">The Story</h3>\n<p>Shoedazzle partnered with Snapchat to raise awareness of its online fashion subscription service among its key audience, women 18 and older. It also looked to test different creatives and optimizations to better understand how it could lower cost-per-leads and acquisitions. </p>', NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:32:30', '2017-09-15 21:41:08', 'f2b4d443-6d73-4f21-8307-8cbb86e9393c'),
