 ('722', '603', 'en_us', NULL, NULL, 'left', '<p>Shoedazzle worked with Snapchat to develop a Snap Ads Web View campaign, which combines a short video teaser with a website only one swipe away. Shoedazzle also optimized its campaign to hit its cost-per-leads and cost-per-acquisition targets. To make it happen, Shoedazzle created various fashion-forward Top Snaps that encouraged Snapchatters to swipe up and take a “style quiz,” and to unlock a discount on their first purchase.</p>\n<p>Shoedazzle also worked with 4C, a Snapchat Ads Partner, to optimize its Snap Ads campaign for lower cost-per-leads using Goal Based Bidding for swipes. Additionally, Shoedazzle used its first-party data to exclude current Shoedazzle subscribers, improving overall efficiency by reaching only net new members. <a href=\"https://snappublisher.snapchat.com/welcome\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Snap Ad.</a></p>', NULL, 'Snap Ads Web View', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:32:30', '2017-09-15 21:41:08', '6b3d2d5e-6e2d-411b-8499-a72c4d4ff1f0');
