 ('755', '637', 'en_us', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h3 class=\"block-headline\">The Story</h3>\n<p>The Bungalow is a popular seaside bar with two locations along the California coast: Santa Monica and Huntington Beach. After noticing many of its customers Snapping in its locations, The Bungalow partnered with Snapchat to create Geofilters only accessible at its locations — fun design overlays perfect for framing the moments Snapchatters were sharing. </p>', NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:45:50', '2017-09-15 21:40:49', 'c5e5535a-e877-4408-be58-b73b3bf55121'),
 ('756', '637', 'de_de', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<h3 class=\"block-headline\">The Story</h3>\n<p>The Bungalow is a popular seaside bar with two locations along the California coast: Santa Monica and Huntington Beach. After noticing many of its customers Snapping in its locations, The Bungalow partnered with Snapchat to create Geofilters only accessible at its locations — fun design overlays perfect for framing the moments Snapchatters were sharing. </p>', NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:45:50', '2017-09-15 21:40:49', 'ce1338e3-1358-4928-a1e6-8957a861652a'),
 ('757', '638', 'en_us', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:45:50', '2017-09-15 21:40:49', '40c0da7f-6a26-4363-928e-f74aca47c8cf'),
 ('758', '638', 'de_de', NULL, NULL, 'left', NULL, NULL, NULL, 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:45:50', '2017-09-15 18:45:50', 'ec31e026-f95b-412a-a754-7ef00298be09'),
 ('759', '641', 'en_us', NULL, NULL, 'left', '<p>The Bungalow bought two Geofilters on an annual basis, and ran one over each of its locations. Through its annual plan\'s creative swap capabilities, The Bungalow periodically swapped in new designs, including some that promoted upcoming special events. Snapchatters could then apply those filters to their Snaps and send them to close friends or post them to their Story. The Geofilters were a huge success. Over one in three Snapchatters at The Bungalow who saw its filter applied it to their Snaps. Not only were the filters a nice way for Snapchatters to let friends know where they were, but it put The Bungalow’s brand front and center inside those conversations. <a href=\"https://geofilters.snapchat.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Filter.</a></p>', NULL, 'Creative Solution: Geofilter + Annual Plan', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 18:45:50', '2017-09-15 21:40:49', '3568f4a0-8770-405b-bea1-3d17a0c621a5'),
