 ('793', '662', 'en_us', NULL, NULL, 'left', '<p>Acorns’ Snap Ads App Install campaign garnered one of the company’s highest views-to-install ratios ever. Despite initial reservations about the differences between Snapchat’s playful experience and the general perception of a “finance” app, Acorns overcame that gap with Top Snaps that showcased how fun and easy Acorns is to use. Acorns also used Snapchat’s targeting capabilities to reach lookalikes and Snapchatters 25 and older, driving a 13% higher conversion rate among its target audience. <a href=\"https://snappublisher.snapchat.com/welcome\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Snap Ad.</a></p>', NULL, 'Creative Solution: Snap Ads App Install', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 19:01:38', '2017-09-15 21:40:28', 'e6518548-3a49-4211-878d-76dbb33ae2eb'),
