 ('851', '722', 'en_us', NULL, NULL, 'left', '<p>STX developed a series of Filters for the weeks leading up to the movie’s release, as well as a short period after. The Filters featured the titular “Bye Bye Man,” as well as a reminder of when the movie would be playing in theaters. To reach its intended audience, STX placed its Filters over high schools, colleges, and movie theaters in the US. <a href=\"https://geofilters.snapchat.com/\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Filter.</a><br /></p>', NULL, 'The Creative Solution: High School + Movie Theater Filters', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 20:49:40', '2017-09-15 21:36:54', '9782cb64-8348-4f1e-aff9-e16c9daacf48'),
