 ('895', '753', 'en_us', NULL, NULL, 'left', '<p>Capital One’s first Snap Ad + Web View featured Charles Barkley, who asked Snapchatters to swipe up and play “Snack Hoodie” to help him catch food falling from the sky. The second Snap Ad Web View featured Samuel L. Jackson, who encouraged viewers to swipe up and play “Steaks on a Plane,” which is exactly what it sounds like. Lastly, Snapchatters could swipe up on Capital One’s Long-Form Video Snap Ad to view the brand’s popular March Madness TV spot, which featured Barkley, Jackson, and Spike Lee. <a href=\"https://snappublisher.snapchat.com/welcome\" target=\"_blank\" rel=\"noreferrer noopener\">Make a Snap Ad.</a><br /></p>\n', NULL, 'The Creative Solution: Snap Ads + Web View & Long-form Video', 'blue', '0', 'primary', NULL, 'gray', NULL, 'normal', NULL, NULL, NULL, NULL, NULL, NULL, '0.0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'website', NULL, NULL, NULL, NULL, NULL, 'left', '0', NULL, NULL, NULL, NULL, '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-15 21:18:17', '2017-09-15 21:18:17', '43e31c4b-20c7-4ce9-88ec-07a9c053b5aa'),
