 ('171', '492', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Clean & Clear\",\"slug\":\"clean-clear\",\"postDate\":1505432550,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"40\":\"#140080\",\"38\":\"\",\"151\":\"\",\"42\":\"Clean & Clear achieved a 9% increase in Brand Awareness with its squeaky clean Snap Ads and Filters campaign.\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"Find your inspiration\",\"198\":{\"new1\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"358\"]}},\"new3\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"356\"]}},\"new4\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\",\"257\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3><p>Clean & Clear looked to Snapchat to help raise awareness of its Morning Burst facial cleanser among females age 13 to 24. Clean & Clear wanted to create ads in a few different formats to engage Snapchatters in a variety of ways &mdash; a video ad to tell a story in motion, a written segment to offer tips, and an interactive ad that would inspire viewers to get creative. <\\/p>\\r\\n<p><br><\\/p>\"}},\"new2\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+40.2M\",\"smallText\":\"<p>Total Views<\\/p>\"}},\"new2\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+9%\",\"smallText\":\"<p>Increase in Brand Awareness Among Female Snapchatters 13 to 24<\\/p>\"}},\"new3\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"3.6%\",\"smallText\":\"<p>Snap Ads Article Swipe-Up Rate<\\/p>\"}}}}},\"new3\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Filter\",\"paragraph_loc\":\"<p>Clean & Clear launched its Filters over high schools and college campuses to give its audience a way to frame their selfies and send them to friends. Sparkling bubbles and the positive message \\u201cFace so Fresh\\u201d resonated well with Snapchatters. Additionally, the creative\\u2019s Clean & Clear logo helped increase Brand Awareness among Snapchatters who both used or received the Filter.<\\/p>\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+16%\",\"smallText_loc\":\"Increase in Brand Awareness from the Geofilter\"}}},\"flipContent\":\"\"}},\"new4\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"A fresh-faced filter to share with friends\"}}},\"86\":[\"246\"],\"87\":[\"243\"],\"155\":\"Clean & Clear\"}}', '2017-09-14 23:42:30', '2017-09-14 23:42:30', '5b2215bb-d72d-46b9-80ef-88f34feb1e8c'),
