 ('186', '492', '4', '1', 'en_us', '2', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Clean & Clear\",\"slug\":\"clean-clear\",\"postDate\":1505432520,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"40\":\"#140080\",\"38\":\"\",\"151\":[\"519\"],\"42\":\"Clean & Clear achieved a 9% increase in Brand Awareness with its squeaky clean Snap Ads and Filters campaign.\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"Find your inspiration\",\"198\":{\"501\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"358\"]}},\"502\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"356\"]}},\"503\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\",\"257\"],\"179\":{\"493\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Clean & Clear looked to Snapchat to help raise awareness of its Morning Burst facial cleanser among females age 13 to 24. Clean & Clear wanted to create ads in a few different formats to engage Snapchatters in a variety of ways &mdash; a video ad to tell a story in motion, a written segment to offer tips, and an interactive ad that would inspire viewers to get creative. <\\/p>\\r\\n<p><br><\\/p>\"}},\"494\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"495\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+40.2M\",\"smallText\":\"<p>Total Views<\\/p>\"}},\"496\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+9%\",\"smallText\":\"<p>Increase in Brand Awareness Among Female Snapchatters 13 to 24<\\/p>\"}},\"497\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"3.6%\",\"smallText\