mallText\":\"<p>Increase in Brand Awareness Among Female Snapchatters 13 to 24<\\/p>\"}}}}},\"498\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Filter\",\"paragraph_loc\":\"<p>Clean & Clear launched its Filters over high schools and college campuses to give its audience a way to frame their selfies and send them to friends. Sparkling bubbles and the positive message \\u201cFace so Fresh\\u201d resonated well with Snapchatters. Additionally, the creative\\u2019s Clean & Clear logo helped increase Brand Awareness among Snapchatters who both used or received the Filter. <a href=\\\"http:\\/\\/geofilters.snapchat.com\\\" target=\\\"_blank\\\">Make a Filter.<\\/a><\\/p>\",\"storyMetrics\":{\"499\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+16%\",\"smallText_loc\":\"Increase in Brand Awareness from the Geofilter\"}}},\"flipContent\":\"\"}},\"544\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":[\"541\"],\"imageAltText_loc\":\"Clean & Clear Filter\",\"caption_loc\":\"A fresh-faced filter to share with friends\"}},\"545\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\" Snap Ads\",\"paragraph_loc\":\"<p>Clean & Clear partnered with Snapchat to run animated Snap Ads that reached the right people at the right time. Clean & Clear used Snapchat\\u2019s Lifestyle Categories to optimize its Snap Ads between Stories campaign and reach Snapchatters more likely to be interested in beauty. The bright, happy creative featured the Morning Burst face wash, encouraging Snapchatters to \\u201cWake up tired skin.\\u201d <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":\"\",\"flipContent\":\"1\"}},\"546\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters were encouraged to \\u201cWake up Tired Skin\\u201d with Morning Burst\"}},\"547\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Snap Ads Article\",\"paragraph_loc\":\"<p>Clean & Clear ran a Snap Ads Articles campaign across Discover, as well as a takeover of Refinery 29\\u2019s Publisher Story to reach its intended audience. When Snapchatters saw Clean and Clear\\u2019s Top Snap, which read \\u201cDoes your skin feel blah in the morning?\\u201d, they could swipe up to read helpful articles on proper skin care. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"548\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+3.6%\",\"smallText_loc\":\"Snap Ads Article Swipe-Up Rate\"}}},\"flipContent\":\"\"}},\"549\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up for articles on proper skin care\"}},\"550\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">Results<\\/h3>\\r\\n<p>Clean & Clear\\u2019s Snap Ads and Filters campaign generated an 11.2% lift in Aided Awareness (5.5X higher than Millward Brown Norms) and a 7% lift in brand favorability (3.5X higher than Millward Brown Mobile Norms). <\\/p>\"}},\"552\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"553\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"542\"],\"imageAltText\":\"Download Clean & Clear PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download Clean & Clear PDF\"}}}}},\"551\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<p>Source: Snapchat Internal Data, Millward Brown Digital Audience and Brand Lift Insights<\\/p>\"}}},\"86\":[\"246\"],\"87\":[\"243\"],\"155\":\"Clean & Clear\"}}', '2017-09-15 18:06:14', '2017-09-15 18:06:14', '020a687c-4439-4603-9c39-39291231ad90'),
