 ('201', '533', '4', '1', 'en_us', '2', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Now 61\",\"slug\":\"now-61\",\"postDate\":1505496960,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#FFD05A\",\"38\":[\"564\"],\"151\":\"\",\"42\":\"Thanks to Snap Ads\\u2019 new deep-linking capabilities, Now That\\u2019s What I Call Music! saw 54% of iTunes conversions coming directly from Snapchat.\",\"103\":\"\",\"177\":\"\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":{\"new1\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"521\"]}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"565\"],\"imageAltText_loc\":\"Now61 Hero Image\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Now That\\u2019s What I Call Music! turned to Snapchat when it looked to promote its 61st edition of the iconic Now! series. Now! hoped to do so with a creative execution that could let listeners immediately access Now 61 across popular mobile music streaming services. Featuring hits from artists like Bruno Mars, Ariana Grande, Kendrick Lamar, The Weeknd and more, Now 61 was ready to turn it up.<\\/p>\\r\\n\"}},\"new2\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+2.7m\",\"smallText\":\"<p>Top Snap Views<\\/p>\"}},\"new2\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+1.5m\",\"smallText\":\"<p>Snapchatters Reached<\\/p>\"}}}}},\"new3\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\" Snap Ads Web View\",\"paragraph_loc\":\"<p>Now! partnered with Snapchat to take part in one of the platform\\u2019s first deep-link Snap Ads Web View executions. To grab Snapchatters\\u2019 attentions, Now! created full-screen, vertical video Top Snaps which prominently featured Now 61\\u2019s music and roster of pop stars. Snapchatters could then swipe up to access a list of music streaming services which, when tapped on, took them directly to the album in their streaming service of choice.<\\/p>\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+3.37%\",\"smallText_loc\":\"Swipe-Up Rate\"}}},\"flipContent\":\"\"}},\"new4\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up to hear Now 61 across music streaming services\"}},\"new5\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">Results<\\/h3><p>\\r\\n<\\/p><p>\\u201cSnapchat had a 17% engagement rate for the NOW 61 release, which was 31% higher than another video partner we used, and accounted for 54% of total iTunes conversions during the Snapchat campaign flight.\\u201d <br><\\/p>\\r\\n<p><cite class=\\\"block-quote-author\\\">\\u2013 Christina Schrenk, Quigley-Simpson<\\/cite><\\/p>\\r\\n\"}},\"new6\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"new1\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"567\"],\"imageAltText\":\"Download Now61 PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the Now61 PDF\"}}}}},\"new7\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<p>Source:&nbsp;Snapchat Internal Data<\\/p>\"}}},\"86\":[\"253\"],\"87\":[\"245\"],\"155\":\"Now 61\"}}', '2017-09-15 18:12:22', '2017-09-15 18:12:22', 'ce4494a6-bd4c-4b9c-9253-d6de9d6945fa'),
