 ('204', '597', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"ShoeDazzle\",\"slug\":\"shoedazzle\",\"postDate\":1505500349,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#F2068B\",\"38\":[\"581\"],\"151\":\"\",\"42\":\"Over 18M Snapchatters swiped up on Shoedazzle\\u2019s Snap Ad to discover their style profile\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":{\"new1\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"583\"],\"imageAltText_loc\":\"ShoeDazzle Hero\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Shoedazzle partnered with Snapchat to raise awareness of its online fashion subscription service among its key audience, women 18 and older. It also looked to test different creatives and optimizations to better understand how it could lower cost-per-leads and acquisitions. <\\/p>\\r\\n\"}},\"new2\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+18m\",\"smallText\":\"<p>Total Top Snap Views<\\/p>\"}},\"new2\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"70%\",\"smallText\":\"<p>Lower CPM with Use of Auction Best Practices<\\/p>\"}}}}},\"new3\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Snap Ads Web View\",\"paragraph_loc\":\"<p>Shoedazzle worked with Snapchat to develop a Snap Ads Web View campaign, which combines a short video teaser with a website only one swipe away. Shoedazzle also optimized its campaign to hit its cost-per-leads and cost-per-acquisition targets. To make it happen, Shoedazzle created various fashion-forward Top Snaps that encouraged Snapchatters to swipe up and take a \\u201cstyle quiz,\\u201d and to unlock a discount on their first purchase.<\\/p>\\r\\n<p>Shoedazzle also worked with 4C, a Snapchat Ads Partner, to optimize its Snap Ads campaign for lower cost-per-leads using Goal Based Bidding for swipes. Additionally, Shoedazzle used its first-party data to exclude current Shoedazzle subscribers, improving overall efficiency by reaching only net new members. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><\\/p>\\r\\n\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"2.12%\",\"smallText_loc\":\"Swipe-up Rate\"}}},\"flipContent\":\"\"}},\"new4\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up to take quizzes and unlock discounts\"}},\"new5\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">Results<\\/h3>\\r\\n<p>Thanks to a combination of strong creative, audience reach capabilities, and bid optimizations, the campaign outperformed Shoedazzle\\u2019s cost-per-lead goal.<\\/p>\"}},\"new6\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"new1\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"582\"],\"imageAltText\":\"Download the ShoeDazzle PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the ShoeDazzle PDF\"}}}}},\"new7\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<p><strong><b>Source: Snapchat Internal Data; 4C<\\/b><\\/strong><\\/p>\"}}},\"86\":[\"248\"],\"87\":[\"245\"],\"155\":\"ShoeDazzle\"}}', '2017-09-15 18:32:30', '2017-09-15 18:32:30', '4bef9269-cd94-41e5-b5f0-85fdefd94ad1'),
