 ('210', '635', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"The Bungalow\",\"slug\":\"the-bungalow\",\"postDate\":1505501149,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#1A9FDE\",\"38\":[\"614\"],\"151\":[\"634\"],\"42\":\"The Bungalow\\u2019s Filters generated over 300K views and a 30% conversion rate\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"257\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"612\"],\"imageAltText_loc\":\"The Bungalow Hero\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>The Bungalow is a popular seaside bar with two locations along the California coast: Santa Monica and Huntington Beach. After noticing many of its customers Snapping in its locations, The Bungalow partnered with Snapchat to create Geofilters only accessible at its locations &mdash; fun design overlays perfect for framing the moments Snapchatters were sharing. <\\/p>\\r\\n\"}},\"new2\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+300K\",\"smallText\":\"<p>Views<\\/p>\"}},\"new2\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+30%\",\"smallText\":\"<p>Use Rate<\\/p>\"}}}}},\"new3\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Creative Solution: Geofilter + Annual Plan\",\"paragraph_loc\":\"<p>The Bungalow bought two Geofilters on an annual basis, and ran one over each of its locations. Through its annual plan\'s creative swap capabilities, The Bungalow periodically swapped in new designs, including some that promoted upcoming special events. Snapchatters could then apply those filters to their Snaps and send them to close friends or post them to their Story. The Geofilters were a huge success. Over one in three Snapchatters at The Bungalow who saw its filter applied it to their Snaps. Not only were the filters a nice way for Snapchatters to let friends know where they were, but it put The Bungalow\\u2019s brand front and center inside those conversations. <a href=\\\"https:\\/\\/geofilters.snapchat.com\\/\\\" target=\\\"_blank\\\">Make a Filter.<\\/a><\\/p>\",\"storyMetrics\":\"\",\"flipContent\":\"\"}},\"new4\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":\"\",\"imageAltText_loc\":\"\",\"caption_loc\":\"Filter designs changed out over the course of the year, giving Snapchatters creative variety\"}},\"new5\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":\"\",\"imageAltText_loc\":\"\",\"caption_loc\":\"Each Filter design put the brand front and center\"}},\"new6\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"new1\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"611\"],\"imageAltText\":\"Download The Bungalow PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download The Bungalow PDF\"}}}}}},\"86\":[\"247\"],\"87\":[\"243\"],\"155\":\"The Bungalow\"}}', '2017-09-15 18:45:50', '2017-09-15 18:45:50', '9f07c7f4-b229-4164-a81e-565e744425c3'),
 ('211', '654', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Acorns\",\"slug\":\"acorns\",\"postDate\":1505502098,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#7ABF4B\",\"38\":[\"653\"],\"151\":[\"647\"],\"42\":\"Acorns\\u2019 Snap Ads App Install campaign drove an 8.5% conversion rate\",\"103\":\"\",\"177\":\"\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"652\"],\"imageAltText_loc\":\"Acorns Hero\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Acorns &mdash; a new service that makes it easy to invest your spare change &mdash; has historically received its best advertising returns on mobile platforms with a large, young, and tech-savvy audience. So for their next mobile advertising campaign, Acorns looked to launch one that would increase both brand awareness and app installs.<\\/p>\\r\\n\"}},\"new2\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+2.6M\",\"smallText\":\"<p>8.5% Conversion RateTop Snap Views<\\/p>\"}}}}},\"new3\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"8.5%\",\"smallText\":\"<p>Conversion Rate<\\/p>\"}},\"new2\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"3%\",\"smallText\":\"<p>Swipe-up Rate<\\/p>\"}}}}},\"new4\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Creative Solution: Snap Ads App Install\",\"paragraph_loc\":\"<p>Acorns\\u2019 Snap Ads App Install campaign garnered one of the company\\u2019s highest views-to-install ratios ever. Despite initial reservations about the differences between Snapchat\\u2019s playful experience and the general perception of a \\u201cfinance\\u201d app, Acorns overcame that gap with Top Snaps that showcased how fun and easy Acorns is to use. Acorns also used Snapchat\\u2019s targeting capabilities to reach lookalikes and Snapchatters 25 and older, driving a 13% higher conversion rate among its target audience. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><\\/p>\\r\\n\",\"storyMetrics\":\"\",\"flipContent\":\"\"}}},\"86\":[\"252\",\"249\"],\"87\":[\"245\"],\"155\":\"Acorns\"}}', '2017-09-15 19:01:38', '2017-09-15 19:01:38', '2a0d6c4d-2ded-420e-935b-2e4783e3e145'),
