 ('217', '711', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"The Bye Bye Man\",\"slug\":\"the-bye-bye-man\",\"postDate\":1505508580,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"\",\"38\":[\"710\"],\"151\":[\"705\"],\"42\":\"\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\",\"257\",\"258\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"709\"],\"imageAltText_loc\":\"The Bye Bye Man Hero\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>For the January 2017 release of its new movie, <i>The Bye Bye Man<\\/i>, STX Entertainment looked to generate awareness and watch intent among its intended audience of Snapchatters age 13 to 24, and drive ticket sales for the film\\u2019s opening weekend. They hoped to do so with fun and interactive ad products that encouraged people to engage and share with friends. <\\/p>\"}},\"new2\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+42.5M\",\"smallText\":\"<p>Total unique Snapchatters Reached<\\/p>\"}},\"new2\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+177.8M\",\"smallText\":\"<p>Total Impressions<\\/p>\"}},\"new3\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+20.7%\",\"smallText\":\"<p>Increase in Ad Awareness<\\/p>\"}},\"new4\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+7.9%\",\"smallText\":\"<p>Lift in Watch Intent<\\/p>\"}}}}},\"new3\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: Snap Ads\",\"paragraph_loc\":\"<p>STX recut its existing trailers into bite-sized, fullscreen Snap Ads and ran them across Snapchat to fill Snapchatters in on the film\\u2019s release date. STX optimized its Snap Ads campaign to reach Snapchatters more likely to watch movies in theaters, as those who had previously interacted with STX\\u2019s Snapchat ads. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+41.3M\",\"smallText_loc\":\"Snap Ads Impressions\"}}},\"flipContent\":\"\"}},\"new4\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"The ads reached an audience of engaged moviegoers\"}},\"new5\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: High School + Movie Theater Filters\",\"paragraph_loc\":\"<p>STX developed a series of Filters for the weeks leading up to the movie\\u2019s release, as well as a short period after. The Filters featured the titular \\u201cBye Bye Man,\\u201d as well as a reminder of when the movie would be playing in theaters. To reach its intended audience, STX placed its Filters over high schools, colleges, and movie theaters in the US. <a href=\\\"https:\\/\\/geofilters.snapchat.com\\/\\\" target=\\\"_blank\\\">Make a Filter.<\\/a><br><\\/p>\\r\\n\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+13.8M\",\"smallText_loc\":\"Unique reach across all Filters\"}}},\"flipContent\":\"1\"}},\"new6\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"The Filter reached an audience of engaged moviegoers\"}},\"new7\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\" The Creative Solution: National Lens\",\"paragraph_loc\":\"<p>STX worked closely with Snapchat to develop two different Lenses that snuck the Bye Bye Man into Snapchatters\\u2019 Snaps. The Lenses also included the movie\\u2019s release date, serving as a helpful reminder when sent to friends. The Lenses were available all across the US &mdash; the first one a month before, and the second just a couple days before the movie\\u2019s launch, keeping the film at the top of everyone\\u2019s mind! Learn more about Lenses.<br><\\/p>\\r\\n\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"20.5s\",\"smallText_loc\":\"Average Play Time\"}},\"new2\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+49M\",\"smallText_loc\":\"Lens Impressions\"}}},\"flipContent\":\"\"}},\"new8\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"The Lens snuck the Bye Bye Man into Snapchatters\\u2019 Snaps\"}},\"new9\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"new1\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"708\"],\"imageAltText\":\"Download the Bye Bye Man PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the Bye Bye Man PDF\"}}}}}},\"86\":[\"253\"],\"87\":\"\",\"155\":\"The Bye Bye Man\"}}', '2017-09-15 20:49:41', '2017-09-15 20:49:41', '33a4f5b6-b0a8-404c-a7ab-acb94351dac9'),
