 ('220', '739', '4', '1', 'en_us', '2', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Capital One\",\"slug\":\"capital-one\",\"postDate\":1505509080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#00477b\",\"38\":[\"738\"],\"151\":[\"732\"],\"42\":\"\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"See other finance success stories\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\",\"257\",\"258\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"737\"],\"imageAltText_loc\":\"Capital One Hero\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Last March, Capital One looked to expand and strengthen its NCAA March Madness sponsorship by bringing its creative to life on Snapchat. By using every ad product Snapchat offers, Capital One hoped to increase sponsorship association and engage with a large audience in fun, playful ways.<\\/p>\"}},\"new2\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"new1\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+11.6%\",\"smallText\":\"<p>Increase in Sponsorship Association<\\/p>\"}},\"new2\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+12.6%\",\"smallText\":\"<p>Lift in Brand Favorability<\\/p>\"}},\"new3\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+7.9%\",\"smallText\":\"<p>Lift in Consideration<\\/p>\"}}}}},\"new3\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: National Lenses\",\"paragraph_loc\":\"<p>Right before the Final Four and National Championships game, Capital One launched two unique Lenses which ran across the US, for one day each. Both Lenses made nods to Capital One\\u2019s broader marketing campaign: the first gave Snapchatters a way to try on Charles Barkley\\u2019s \\u201cSnack Hoodie\\u201d for themselves, and the second let Snapchatters celebrate their own personal National Championships \\u201cwin.\\u201d <a href=\\\"https:\\/\\/forbusiness.snapchat.com\\/ad-products\\\" target=\\\"_blank\\\">Learn more about Lenses.<\\/a><\\/p>\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+15.7s\",\"smallText_loc\":\"Average Lens play time\"}},\"new2\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+49M\",\"smallText_loc\":\"Lens Impressions\"}}},\"flipContent\":\"\"}},\"new4\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters played with the famed \\u201cSnack Hoodie\\u201d\"}},\"new5\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters experienced their own win with a trophy and confetti\"}},\"new6\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: Snap Ads + Web View & Long-form Video\",\"paragraph_loc\":\"<p>Capital One\\u2019s first Snap Ad + Web View featured Charles Barkley, who asked Snapchatters to swipe up and play \\u201cSnack Hoodie\\u201d to help him catch food falling from the sky. The second Snap Ad Web View featured Samuel L. Jackson, who encouraged viewers to swipe up and play \\u201cSteaks on a Plane,\\u201d which is exactly what it sounds like. Lastly, Snapchatters could swipe up on Capital One\\u2019s Long-Form Video Snap Ad to view the brand\\u2019s popular March Madness TV spot, which featured Barkley, Jackson, and Spike Lee. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><br><\\/p>\\r\\n\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+24m\",\"smallText_loc\":\"Snap Ads Impressions\"}},\"new2\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"32.2s\",\"smallText_loc\":\"Average Time Spent on Attachments\"}}},\"flipContent\":\"1\"}},\"new7\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up to play Charles Barkley\'s Snack Hoodie game\"}},\"new8\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Capital One built awareness of their March Madness TV spot\"}},\"new9\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: Snapcodes for Filters, Lenses\",\"paragraph_loc\":\"<p>Snapchatters watching the Final Four and the Championships in the stadiums live could unlock location-specific Filters by taking Snaps of Snapcodes that appeared on the jumbotron. Capital One also included Snapcodes in its TV spots, which unlocked an exclusive Lens Snapchatters could use and send to their friends. <a href=\\\"https:\\/\\/scan.snapchat.com\\/\\\" target=\\\"_blank\\\">Learn more about Snapcodes.<\\/a><\\/p>\\r\\n\",\"storyMetrics\":\"\",\"flipContent\":\"\"}},\"new10\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":