 ('225', '711', '4', '1', 'en_us', '2', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"The Bye Bye Man\",\"slug\":\"the-bye-bye-man\",\"postDate\":1505508540,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"\",\"38\":[\"710\"],\"151\":[\"705\"],\"42\":\"\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\",\"257\",\"258\"],\"179\":{\"712\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"709\"],\"imageAltText_loc\":\"The Bye Bye Man Hero\"}},\"713\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>For the January 2017 release of its new movie, <em>The Bye Bye Man<\\/em>, STX Entertainment looked to generate awareness and watch intent among its intended audience of Snapchatters age 13 to 24, and drive ticket sales for the film\\u2019s opening weekend. They hoped to do so with fun and interactive ad products that encouraged people to engage and share with friends. <\\/p>\"}},\"714\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"715\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+42.5M\",\"smallText\":\"<p>Total unique Snapchatters Reached<\\/p>\"}},\"716\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+177.8M\",\"smallText\":\"<p>Total Impressions<\\/p>\"}},\"717\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+20.7%\",\"smallText\":\"<p>Increase in Ad Awareness<\\/p>\"}},\"718\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+7.9%\",\"smallText\":\"<p>Lift in Watch Intent<\\/p>\"}}}}},\"719\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: Snap Ads\",\"paragraph_loc\":\"<p>STX recut its existing trailers into bite-sized, fullscreen Snap Ads and ran them across Snapchat to fill Snapchatters in on the film\\u2019s release date. STX optimized its Snap Ads campaign to reach Snapchatters more likely to watch movies in theaters, as those who had previously interacted with STX\\u2019s Snapchat ads. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"720\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+41.3M\",\"smallText_loc\":\"Snap Ads Impressions\"}}},\"flipContent\":\"\"}},\"721\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"The ads reached an audience of engaged moviegoers\"}},\"722\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: High School + Movie Theater Filters\",\"paragraph_loc\":\"<p>STX developed a series of Filters for the weeks leading up to the movie\\u2019s release, as well as a short period after. The Filters featured the titular \\u201cBye Bye Man,\\u201d as well as a reminder of when the movie would be playing in theaters. To reach its intended audience, STX placed its Filters over high schools, colleges, and movie theaters in the US. <a href=\\\"https:\\/\\/geofilters.snapchat.com\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Filter.<\\/a><br><\\/p>\",\"storyMetrics\":{\"723\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+13.8M\",\"smallText_loc\":\"Unique reach across all Filters\"}}},\"flipContent\":\"1\"}},\"724\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"The Filter reached an audience of engaged moviegoers\"}},\"725\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\" The Creative Solution: National Lens\",\"paragraph_loc\":\"<p>STX worked closely with Snapchat to develop two different Lenses that snuck the Bye Bye Man into Snapchatters\\u2019 Snaps. The Lenses also included the movie\\u2019s release date, serving as a helpful reminder when sent to friends. The Lenses were available all across the US &mdash; the first one a month before, and the second just a couple days before the movie\\u2019s launch, keeping the film at the top of everyone\\u2019s mind! <a href=\\\"https:\\/\\/forbusiness.snapchat.com\\/ad-products\\\" target=\\\"_blank\\\">Learn more about Lenses.<\\/a><br><\\/p>\",\"storyMetrics\":{\"726\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"20.5s\",\"smallText_loc\":\"Average Play Time\"}},\"727\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+49M\",\"smallText_loc\":\"Lens Impressions\"}}},\"flipContent\":\"\"}},\"728\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"The Lens snuck the Bye Bye Man into Snapchatters\\u2019 Snaps\"}},\"729\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"730\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"708\"],\"imageAltText\":\"Download the Bye Bye Man PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the Bye Bye Man PDF\"}}}}}},\"86\":[\"253\"],\"87\":\"\",\"155\":\"The Bye Bye Man\"}}', '2017-09-15 21:36:54', '2017-09-15 21:36:54', 'fbbf3331-4049-4815-848b-ff4c23bdc1d9'),
 ('226', '654', '4', '1', 'en_us', '2', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Acorns\",\"slug\":\"acorns\",\"postDate\":1505502060,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#7ABF4B\",\"38\":[\"653\"],\"151\":[\"647\"],\"42\":\"Acorns\\u2019 Snap Ads App Install campaign drove an 8.5% conversion rate\",\"103\":\"\",\"177\":\"\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"See other finance success stories\",\"198\":{\"new1\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"739\"]}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"655\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"652\"],\"imageAltText_loc\":\"Acorns Hero\"}},\"656\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Acorns &mdash; a new service that makes it easy to invest your spare change &mdash; has historically received its best advertising returns on mobile platforms with a large, young, and tech-savvy audience. So for their next mobile advertising campaign, Acorns looked to launch one that would increase both brand awareness and app installs.<\\/p>\"}},\"657\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"658\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+2.6M\",\"smallText\":\"<p>8.5% Conversion RateTop Snap Views<\\/p>\"}}}}},\"659\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"660\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"8.5%\",\"smallText\":\"<p>Conversion Rate<\\/p>\"}},\"661\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"3%\",\"smallText\":\"<p>Swipe-up Rate<\\/p>\"}}}}},\"662\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Creative Solution: Snap Ads App Install\",\"paragraph_loc\":\"<p>Acorns\\u2019 Snap Ads App Install campaign garnered one of the company\\u2019s highest views-to-install ratios ever. Despite initial reservations about the differences between Snapchat\\u2019s playful experience and the general perception of a \\u201cfinance\\u201d app, Acorns overcame that gap with Top Snaps that showcased how fun and easy Acorns is to use. Acorns also used Snapchat\\u2019s targeting capabilities to reach lookalikes and Snapchatters 25 and older, driving a 13% higher conversion rate among its target audience. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"new1\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+13%\",\"smallText_loc\":\"Higher conversion rate among target audience\"}}},\"flipContent\":\"\"}},\"new0\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"The ad got Snapchatters to swipe up and become customers\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Results<\\/h3><p>\\u201cPer impression, Snapchat results in 38% more installs than the next best app install platform. This proves that the real estate within Snapchat is significantly more valuable and that the Snapchat audience has a high degree of intent when consuming content on the platform.\\u201d&nbsp;<\\/p><p><cite class=\\\"block-quote-author\\\">\\u2013 Manning Field, Chief Commercial Officer<\\/cite><\\/p>\"}},\"new2\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"new1\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"791\"],\"imageAltText\":\"Download the Acorns PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the Acorns PDF\"}}}}}},\"86\":[\"252\",\"249\"],\"87\":[\"245\"],\"155\":\"Acorns\"}}', '2017-09-15 21:40:28', '2017-09-15 21:40:28', 'e3ee166a-2087-4254-b971-51de31041b41'),
 ('227', '635', '4', '1', 'en_us', '2', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"The Bungalow\",\"slug\":\"the-bungalow\",\"postDate\":1505501100,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#1A9FDE\",\"38\":[\"614\"],\"151\":[\"634\"],\"42\":\"The Bungalow\\u2019s Filters generated over 300K views and a 30% conversion rate\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"257\"],\"179\":{\"636\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"612\"],\"imageAltText_loc\":\"The Bungalow Hero\"}},\"637\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>The Bungalow is a popular seaside bar with two locations along the California coast: Santa Monica and Huntington Beach. After noticing many of its customers Snapping in its locations, The Bungalow partnered with Snapchat to create Geofilters only accessible at its locations &mdash; fun design overlays perfect for framing the moments Snapchatters were sharing. <\\/p>\"}},\"638\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"639\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+300K\",\"smallText\":\"<p>Views<\\/p>\"}},\"640\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+30%\",\"smallText\":\"<p>Use Rate<\\/p>\"}}}}},\"641\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Creative Solution: Geofilter + Annual Plan\",\"paragraph_loc\":\"<p>The Bungalow bought two Geofilters on an annual basis, and ran one over each of its locations. Through its annual plan\'s creative swap capabilities, The Bungalow periodically swapped in new designs, including some that promoted upcoming special events. Snapchatters could then apply those filters to their Snaps and send them to close friends or post them to their Story. The Geofilters were a huge success. Over one in three Snapchatters at The Bungalow who saw its filter applied it to their Snaps. Not only were the filters a nice way for Snapchatters to let friends know where they were, but it put The Bungalow\\u2019s brand front and center inside those conversations. <a href=\\\"https:\\/\\/geofilters.snapchat.com\\/\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Filter.<\\/a><\\/p>\",\"storyMetrics\":\"\",\"flipContent\":\"\"}},\"642\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":\"\",\"imageAltText_loc\":\"\",\"caption_loc\":\"Filter designs changed out over the course of the year, giving Snapchatters creative variety\"}},\"643\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":\"\",\"imageAltText_loc\":\"\",\"caption_loc\":\"Each Filter design put the brand front and center\"}},\"644\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"645\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"611\"],\"imageAltText\":\"Download The Bungalow PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download The Bungalow PDF\"}}}}}},\"86\":[\"247\"],\"87\":[\"243\"],\"155\":\"The Bungalow\"}}', '2017-09-15 21:40:49', '2017-09-15 21:40:49', '419a1073-db1a-4bdd-a4e6-1a1ae9fd938c'),
 ('228', '597', '4', '1', 'en_us', '2', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"ShoeDazzle\",\"slug\":\"shoedazzle\",\"postDate\":1505500320,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#F2068B\",\"38\":[\"581\"],\"151\":\"\",\"42\":\"Over 18M Snapchatters swiped up on Shoedazzle\\u2019s Snap Ad to discover their style profile\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":{\"610\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"598\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"583\"],\"imageAltText_loc\":\"ShoeDazzle Hero\"}},\"599\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Shoedazzle partnered with Snapchat to raise awareness of its online fashion subscription service among its key audience, women 18 and older. It also looked to test different creatives and optimizations to better understand how it could lower cost-per-leads and acquisitions. <\\/p>\"}},\"600\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"601\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+18m\",\"smallText\":\"<p>Total Top Snap Views<\\/p>\"}},\"602\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"70%\",\"smallText\":\"<p>Lower CPM with Use of Auction Best Practices<\\/p>\"}}}}},\"603\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Snap Ads Web View\",\"paragraph_loc\":\"<p>Shoedazzle worked with Snapchat to develop a Snap Ads Web View campaign, which combines a short video teaser with a website only one swipe away. Shoedazzle also optimized its campaign to hit its cost-per-leads and cost-per-acquisition targets. To make it happen, Shoedazzle created various fashion-forward Top Snaps that encouraged Snapchatters to swipe up and take a \\u201cstyle quiz,\\u201d and to unlock a discount on their first purchase.<\\/p>\\r\\n<p>Shoedazzle also worked with 4C, a Snapchat Ads Partner, to optimize its Snap Ads campaign for lower cost-per-leads using Goal Based Bidding for swipes. Additionally, Shoedazzle used its first-party data to exclude current Shoedazzle subscribers, improving overall efficiency by reaching only net new members. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"604\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"2.12%\",\"smallText_loc\":\"Swipe-up Rate\"}}},\"flipContent\":\"\"}},\"605\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up to take quizzes and unlock discounts\"}},\"606\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">Results<\\/h3>\\r\\n<p>Thanks to a combination of strong creative, audience reach capabilities, and bid optimizations, the campaign outperformed Shoedazzle\\u2019s cost-per-lead goal.<\\/p>\"}},\"607\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"608\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"582\"],\"imageAltText\":\"Download the ShoeDazzle PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the ShoeDazzle PDF\"}}}}},\"609\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<p><strong><strong>Source: Snapchat Internal Data; 4C<\\/strong><\\/strong><\\/p>\"}}},\"86\":[\"248\"],\"87\":[\"245\"],\"155\":\"ShoeDazzle\"}}', '2017-09-15 21:41:08', '2017-09-15 21:41:08', 'e9ef9f00-6bae-4b3f-9c3c-ce3f7e42c4d4'),
 ('229', '533', '4', '1', 'en_us', '3', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Now 61\",\"slug\":\"now-61\",\"postDate\":1505496960,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#FFD05A\",\"38\":[\"564\"],\"151\":\"\",\"42\":\"54% of Now!\\u2019s total iTunes conversions came directly from Snapchat\",\"103\":\"\",\"177\":\"\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":{\"580\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"521\"]}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"568\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"565\"],\"imageAltText_loc\":\"Now61 Hero Image\"}},\"569\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Now That\\u2019s What I Call Music! turned to Snapchat when it looked to promote its 61st edition of the iconic Now! series. Now! hoped to do so with a creative execution that could let listeners immediately access Now 61 across popular mobile music streaming services. Featuring hits from artists like Bruno Mars, Ariana Grande, Kendrick Lamar, The Weeknd and more, Now 61 was ready to turn it up.<\\/p>\"}},\"570\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"571\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+2.7m\",\"smallText\":\"<p>Top Snap Views<\\/p>\"}},\"572\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+1.5m\",\"smallText\":\"<p>Snapchatters Reached<\\/p>\"}}}}},\"573\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\" Snap Ads Web View\",\"paragraph_loc\":\"<p>Now! partnered with Snapchat to take part in one of the platform\\u2019s first deep-link Snap Ads Web View executions. To grab Snapchatters\\u2019 attentions, Now! created full-screen, vertical video Top Snaps which prominently featured Now 61\\u2019s music and roster of pop stars. Snapchatters could then swipe up to access a list of music streaming services which, when tapped on, took them directly to the album in their streaming service of choice. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"574\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+3.37%\",\"smallText_loc\":\"Swipe-Up Rate\"}}},\"flipContent\":\"\"}},\"575\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up to hear Now 61 across music streaming services\"}},\"576\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">Results<\\/h3>\\r\\n<p>\\r\\n<\\/p>\\r\\n<p>\\u201cSnapchat had a 17% engagement rate for the NOW 61 release, which was 31% higher than another video partner we used, and accounted for 54% of total iTunes conversions during the Snapchat campaign flight.\\u201d <br><\\/p>\\r\\n<p><cite class=\\\"block-quote-author\\\">\\u2013 Christina Schrenk, Quigley-Simpson<\\/cite><\\/p>\"}},\"577\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"578\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"567\"],\"imageAltText\":\"Download Now61 PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the Now61 PDF\"}}}}},\"579\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<p>Source:&nbsp;Snapchat Internal Data<\\/p>\"}}},\"86\":[\"253\"],\"87\":[\"245\"],\"155\":\"Now 61\"}}', '2017-09-15 21:42:19', '2017-09-15 21:42:19', '1b681b02-34d4-4b1c-8d28-9edf461e42e8'),
 ('230', '521', '4', '1', 'en_us', '5', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Episode\",\"slug\":\"episode\",\"postDate\":1505496300,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#86DBDB\",\"38\":[\"558\"],\"151\":[\"559\"],\"42\":\"Episode\\u2019s Snap Ads App Install campaign generated a 5% swipe-up rate\",\"103\":\"\",\"177\":\"\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"Find your inspiration\",\"198\":{\"562\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"533\"]}},\"702\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"561\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"560\"],\"imageAltText_loc\":\"Episode Hero\"}},\"523\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p><em>Episode<\\/em>, an interactive storytelling app exclusive to mobile devices, looked to help new viewers find great <em>Episode <\\/em>stories from its library of over 73,000 titles. <em>Episode <\\/em>hoped to do so with a Snap Ads App Install campaign that could reach its primary audience: mobile users in their teens and older. Additionally, <em>Episode <\\/em>wanted to run the campaign on an advertising platform that allowed for flexible reach capabilities to show the right <em>Episode <\\/em>stories to viewers more likely to be interested in them. <\\/p>\"}},\"524\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"525\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+10.5m\",\"smallText\":\"<p>Top Snap Views<\\/p>\"}},\"526\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+5.7m\",\"smallText\":\"<p>Snapchatters Reached<\\/p>\"}}}}},\"528\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: Snap Ads App Install\",\"paragraph_loc\":\"<p><em>Episode\\u2019s <\\/em>App Install Snap Ads made downloading a breeze, letting Snapchatters swipe up on the Top Snap to seamlessly download <em>Episode <\\/em>&mdash; without ever leaving the Snapchat app. By using Snapchat\\u2019s Lookalike capabilities and Lifestyle Categories, <em>Episode<\\/em> was able to reach Snapchatters who were more likely to be interested in its app. Snapchat Audience Match also helped optimize Snapchatters\\u2019 experiences (and Episode\\u2019s app install campaign) by excluding Snapchatters who already downloaded the app. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"529\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+5%\",\"smallText_loc\":\"Swipe-Up Rate\"}}},\"flipContent\":\"\"}},\"530\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"\"}},\"531\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"532\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"522\"],\"imageAltText\":\"Episode PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the Episode PDF\"}}}}}},\"86\":[\"253\",\"249\"],\"87\":[\"245\"],\"155\":\"Episode\"}}', '2017-09-15 21:43:02', '2017-09-15 21:43:02', 'ef849730-785a-4d62-9a96-2db0b569a203'),
 ('231', '358', '4', '1', 'en_us', '6', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"ABInBev\",\"slug\":\"success-story-entry\",\"postDate\":1503510960,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#A71826\",\"38\":[\"804\"],\"151\":[\"799\"],\"42\":\"Snapchatters spent 30 seconds playing InBev\\u2019s Bud Bowl game \",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"new0\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"803\"],\"imageAltText_loc\":\"AB InBev Hero\"}},\"new1\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3><p>On average, Snapchatters spent 30 seconds playing Anheuser Busch InBev\\u2019s Bud Bowl&nbsp;game in its Snap Ad + Web View.<\\/p>\"}},\"new2\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"new1\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"802\"],\"imageAltText\":\"Download AB InBev PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download AB InBev PDF\"}}}}}},\"86\":[\"246\"],\"87\":[\"245\"],\"155\":\"ABInBev\"}}', '2017-09-15 21:46:26', '2017-09-15 21:46:26', 'a085acf8-7d5f-4854-9a0b-67fba0ae3318'),
 ('232', '492', '4', '1', 'en_us', '6', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Clean & Clear\",\"slug\":\"clean-clear\",\"postDate\":1505432520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#140080\",\"38\":[\"519\"],\"151\":[\"534\"],\"42\":\"Clean & Clear\\u2019s campaign generated a 9% increase in brand awareness\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"Find your inspiration\",\"198\":{\"501\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"533\"]}},\"502\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}},\"503\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\",\"257\"],\"179\":{\"536\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"535\"],\"imageAltText_loc\":\"Clean & Clear hero\"}},\"493\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Clean & Clear looked to Snapchat to help raise awareness of its Morning Burst facial cleanser among females age 13 to 24. Clean & Clear wanted to create ads in a few different formats to engage Snapchatters in a variety of ways &mdash; a video ad to tell a story in motion, a written segment to offer tips, and an interactive ad that would inspire viewers to get creative. <\\/p>\\r\\n<p><br><\\/p>\"}},\"494\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"495\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+40.2M\",\"smallText\":\"<p>Total Views<\\/p>\"}},\"496\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+9%\",\"smallText\":\"<p>Increase in Brand Awareness Among Female Snapchatters 13 to 24<\\/p>\"}}}}},\"498\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Filter\",\"paragraph_loc\":\"<p>Clean & Clear launched its Filters over high schools and college campuses to give its audience a way to frame their selfies and send them to friends. Sparkling bubbles and the positive message \\u201cFace so Fresh\\u201d resonated well with Snapchatters. Additionally, the creative\\u2019s Clean & Clear logo helped increase Brand Awareness among Snapchatters who both used or received the Filter. <a href=\\\"http:\\/\\/geofilters.snapchat.com\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Filter.<\\/a><\\/p>\",\"storyMetrics\":{\"499\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+16%\",\"smallText_loc\":\"Increase in Brand Awareness from the Geofilter\"}}},\"flipContent\":\"\"}},\"544\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":[\"541\"],\"imageAltText_loc\":\"Clean & Clear Filter\",\"caption_loc\":\"A fresh-faced filter to share with friends\"}},\"545\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\" Snap Ads\",\"paragraph_loc\":\"<p>Clean & Clear partnered with Snapchat to run animated Snap Ads that reached the right people at the right time. Clean & Clear used Snapchat\\u2019s Lifestyle Categories to optimize its Snap Ads between Stories campaign and reach Snapchatters more likely to be interested in beauty. The bright, happy creative featured the Morning Burst face wash, encouraging Snapchatters to \\u201cWake up tired skin.\\u201d <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":\"\",\"flipContent\":\"1\"}},\"546\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters were encouraged to \\u201cWake up Tired Skin\\u201d with Morning Burst\"}},\"547\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Snap Ads Article\",\"paragraph_loc\":\"<p>Clean & Clear ran a Snap Ads Articles campaign across Discover, as well as a takeover of Refinery 29\\u2019s Publisher Story to reach its intended audience. When Snapchatters saw Clean and Clear\\u2019s Top Snap, which read \\u201cDoes your skin feel blah in the morning?\\u201d, they could swipe up to read helpful articles on proper skin care. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"548\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+3.6%\",\"smallText_loc\":\"Snap Ads Article Swipe-Up Rate\"}}},\"flipContent\":\"\"}},\"549\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up for articles on proper skin care\"}},\"550\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">Results<\\/h3>\\r\\n<p>Clean & Clear\\u2019s Snap Ads and Filters campaign generated an 11.2% lift in Aided Awareness (5.5X higher than Millward Brown Norms) and a 7% lift in brand favorability (3.5X higher than Millward Brown Mobile Norms). <\\/p>\"}},\"552\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"553\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"542\"],\"imageAltText\":\"Download Clean & Clear PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download Clean & Clear PDF\"}}}}},\"551\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<p>Source: Snapchat Internal Data, Millward Brown Digital Audience and Brand Lift Insights<\\/p>\"}}},\"86\":[\"246\"],\"87\":[\"243\"],\"155\":\"Clean & Clear\"}}', '2017-09-15 21:47:28', '2017-09-15 21:47:28', '64414477-ee09-4681-8c7c-9ef1805a5d68'),
