 ('277', '492', '4', '1', 'en_us', '7', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Clean & Clear\",\"slug\":\"clean-clear\",\"postDate\":1505432520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#140080\",\"38\":[\"519\"],\"151\":[\"534\"],\"42\":\"Clean & Clear\\u2019s campaign generated a 9% increase in brand awareness\",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"Find your inspiration\",\"198\":{\"501\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"533\"]}},\"502\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}},\"503\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\",\"257\"],\"179\":{\"536\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"535\"],\"imageAltText_loc\":\"Clean & Clear hero\"}},\"493\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>Clean & Clear looked to Snapchat to help raise awareness of its Morning Burst facial cleanser among females age 13 to 24. Clean & Clear wanted to create ads in a few different formats to engage Snapchatters in a variety of ways &mdash; a video ad to tell a story in motion, a written segment to offer tips, and an interactive ad that would inspire viewers to get creative. <\\/p>\\r\\n<p><br><\\/p>\"}},\"494\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"495\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+40.2M\",\"smallText\":\"<p>Total Views<\\/p>\"}},\"496\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+9%\",\"smallText\":\"<p>Increase in Brand Awareness Among Female Snapchatters 13 to 24<\\/p>\"}}}}},\"498\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Filter\",\"paragraph_loc\":\"<p>Clean & Clear launched its Filters over high schools and college campuses to give its audience a way to frame their selfies and send them to friends. Sparkling bubbles and the positive message \\u201cFace so Fresh\\u201d resonated well with Snapchatters. Additionally, the creative\\u2019s Clean & Clear logo helped increase Brand Awareness among Snapchatters who both used or received the Filter. <a href=\\\"http:\\/\\/geofilters.snapchat.com\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Filter.<\\/a><\\/p>\",\"storyMetrics\":{\"499\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+16%\",\"smallText_loc\":\"Increase in Brand Awareness from the Geofilter\"}}},\"flipContent\":\"\"}},\"544\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"imageAsset\":[\"541\"],\"imageAltText_loc\":\"Clean & Clear Filter\",\"caption_loc\":\"A fresh-faced filter to share with friends\"}},\"545\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\" Snap Ads\",\"paragraph_loc\":\"<p>Clean & Clear partnered with Snapchat to run animated Snap Ads that reached the right people at the right time. Clean & Clear used Snapchat\\u2019s Lifestyle Categories to optimize its Snap Ads between Stories campaign and reach Snapchatters more likely to be interested in beauty. The bright, happy creative featured the Morning Burst face wash, encouraging Snapchatters to \\u201cWake up tired skin.\\u201d <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":\"\",\"flipContent\":\"1\"}},\"546\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters were encouraged to \\u201cWake up Tired Skin\\u201d with Morning Burst\"}},\"547\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"Snap Ads Article\",\"paragraph_loc\":\"<p>Clean & Clear ran a Snap Ads Articles campaign across Discover, as well as a takeover of Refinery 29\\u2019s Publisher Story to reach its intended audience. When Snapchatters saw Clean and Clear\\u2019s Top Snap, which read \\u201cDoes your skin feel blah in the morning?\\u201d, they could swipe up to read helpful articles on proper skin care. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"548\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+3.6%\",\"smallText_loc\":\"Snap Ads Article Swipe-Up Rate\"}}},\"flipContent\":\"\"}},\"549\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"Snapchatters swiped up for articles on proper skin care\"}},\"550\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">Results<\\/h3>\\r\\n<p>Clean & Clear\\u2019s Snap Ads and Filters campaign generated an 11.2% lift in Aided Awareness (5.5X higher than Millward Brown Norms) and a 7% lift in brand favorability (3.5X higher than Millward Brown Mobile Norms). <\\/p>\"}},\"552\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"553\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"542\"],\"imageAltText\":\"Download Clean & Clear PDF\",\"downloadableAsset\":[\"1286\"],\"caption\":\"Download Clean & Clear PDF\"}}}}},\"551\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<p>Source: Snapchat Internal Data, Millward Brown Digital Audience and Brand Lift Insights<\\/p>\"}}},\"86\":[\"246\"],\"87\":[\"243\"],\"155\":\"Clean & Clear\"}}', '2017-09-18 16:48:59', '2017-09-18 16:48:59', 'd201af12-a110-4a70-8e1e-3332800047d5'),
 ('278', '358', '4', '1', 'en_us', '7', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"ABInBev\",\"slug\":\"success-story-entry\",\"postDate\":1503510960,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#A71826\",\"38\":[\"804\"],\"151\":[\"799\"],\"42\":\"Snapchatters spent 30 seconds playing InBev\\u2019s Bud Bowl game \",\"103\":\"\",\"177\":\"1\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"\",\"198\":\"\",\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"805\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"803\"],\"imageAltText_loc\":\"AB InBev Hero\"}},\"806\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p>On average, Snapchatters spent 30 seconds playing Anheuser Busch InBev\\u2019s Bud Bowl&nbsp;game in its Snap Ad + Web View.<\\/p>\"}},\"807\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"808\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"802\"],\"imageAltText\":\"Download AB InBev PDF\",\"downloadableAsset\":[\"1287\"],\"caption\":\"Download AB InBev PDF\"}}}}}},\"86\":[\"246\"],\"87\":[\"245\"],\"155\":\"ABInBev\"}}', '2017-09-18 16:49:54', '2017-09-18 16:49:54', 'e4cc0d11-24dc-4b4f-8a23-cd2a200e20bc'),
 ('279', '521', '4', '1', 'en_us', '6', '', '{\"typeId\":\"12\",\"authorId\":\"1\",\"title\":\"Episode\",\"slug\":\"episode\",\"postDate\":1505496300,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"40\":\"#86DBDB\",\"38\":[\"558\"],\"151\":[\"559\"],\"42\":\"Episode\\u2019s Snap Ads App Install campaign generated a 5% swipe-up rate\",\"103\":\"\",\"177\":\"\",\"106\":\"\",\"105\":\"\",\"107\":\"website\",\"197\":{\"type\":\"\",\"entry\":\"\",\"customText\":\"\"},\"196\":\"Find your inspiration\",\"198\":{\"562\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":[\"533\"]}},\"702\":{\"type\":\"entry\",\"enabled\":\"1\",\"fields\":{\"entry\":\"\"}}},\"102\":\"\",\"104\":\"\",\"101\":\"\",\"88\":[\"256\"],\"179\":{\"561\":{\"modified\":\"1\",\"type\":\"heroImage\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"image\":[\"560\"],\"imageAltText_loc\":\"Episode Hero\"}},\"523\":{\"modified\":\"1\",\"type\":\"textBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"textBlock\":\"<h3 class=\\\"block-headline\\\">The Story<\\/h3>\\r\\n<p><em>Episode<\\/em>, an interactive storytelling app exclusive to mobile devices, looked to help new viewers find great <em>Episode <\\/em>stories from its library of over 73,000 titles. <em>Episode <\\/em>hoped to do so with a Snap Ads App Install campaign that could reach its primary audience: mobile users in their teens and older. Additionally, <em>Episode <\\/em>wanted to run the campaign on an advertising platform that allowed for flexible reach capabilities to show the right <em>Episode <\\/em>stories to viewers more likely to be interested in them. <\\/p>\"}},\"524\":{\"modified\":\"1\",\"type\":\"metricCards\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"metricCards\":{\"525\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+10.5m\",\"smallText\":\"<p>Top Snap Views<\\/p>\"}},\"526\":{\"type\":\"Card\",\"enabled\":\"1\",\"fields\":{\"largeNumber\":\"+5.7m\",\"smallText\":\"<p>Snapchatters Reached<\\/p>\"}}}}},\"528\":{\"modified\":\"1\",\"type\":\"adProductBlock\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"headline_loc\":\"The Creative Solution: Snap Ads App Install\",\"paragraph_loc\":\"<p><em>Episode\\u2019s <\\/em>App Install Snap Ads made downloading a breeze, letting Snapchatters swipe up on the Top Snap to seamlessly download <em>Episode <\\/em>&mdash; without ever leaving the Snapchat app. By using Snapchat\\u2019s Lookalike capabilities and Lifestyle Categories, <em>Episode<\\/em> was able to reach Snapchatters who were more likely to be interested in its app. Snapchat Audience Match also helped optimize Snapchatters\\u2019 experiences (and Episode\\u2019s app install campaign) by excluding Snapchatters who already downloaded the app. <a href=\\\"https:\\/\\/snappublisher.snapchat.com\\/welcome\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">Make a Snap Ad.<\\/a><\\/p>\",\"storyMetrics\":{\"529\":{\"type\":\"metric\",\"enabled\":\"1\",\"fields\":{\"largeNumber_loc\":\"+5%\",\"smallText_loc\":\"Swipe-Up Rate\"}}},\"flipContent\":\"\"}},\"530\":{\"modified\":\"1\",\"type\":\"video\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"1\",\"fields\":{\"videoAssetMp4\":\"\",\"videoAssetWebm\":\"\",\"posterImage\":\"\",\"caption_loc\":\"\"}},\"531\":{\"modified\":\"1\",\"type\":\"downloads\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"downloadableAsset\":{\"532\":{\"type\":\"assetBlock\",\"enabled\":\"1\",\"fields\":{\"siteImage\":[\"522\"],\"imageAltText\":\"Episode PDF\",\"downloadableAsset\":\"\",\"caption\":\"Download the Episode PDF\"}}}}}},\"86\":[\"253\",\"249\"],\"87\":[\"245\"],\"155\":\"Episode\"}}', '2017-09-18 17:37:44', '2017-09-18 17:37:44', 'a476d997-23c9-4693-968b-deb45fcb930d'),
