 ('1', '476', 'en_us', 'Raise Awareness', '<p>Reach a huge audience with the most engaging ad formats on mobile.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"98\"],\"customText\":\"Explore Solutions\",\"target\":\"\"}', '', 'Raise Awareness', '2017-09-13 17:18:46', '2017-09-15 00:24:57', '2e80d8af-76a2-4f59-b5e9-a6aa6fd04bd1'),
 ('2', '485', 'en_us', 'Increase Consideration', '<p>Inspire our engaged audience to lean in and learn more, seamlessly.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"98\"],\"customText\":\"Explore Solutions\",\"target\":\"\"}', '', 'Increase Consideration', '2017-09-13 17:39:23', '2017-09-15 00:24:57', '896d8acd-be61-4c55-a210-740f75994313'),
 ('3', '486', 'en_us', 'Drive Action', '<p>Make an impact instantly with ads that are fun to interact with.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"98\"],\"customText\":\"Explore Solutions\",\"target\":\"\"}', '', 'Drive Action', '2017-09-13 17:39:24', '2017-09-15 00:24:57', 'b8cca2de-0e89-48a0-9ca5-d46bdb4b4b9a'),
 ('4', '593', 'en_us', 'Snap Ads', '<p>Snap Ads are full-screen, 100% viewable, and have audio on by default.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"292\"],\"customText\":\"\",\"target\":\"\"}', '{\"type\":\"custom\",\"custom\":\"https:\\/\\/businesshelp.snapchat.com\\/en-US\\/article\\/top-snap-specs\",\"entry\":\"\",\"customText\":\"View Guidelines\",\"target\":\"_blank\"}', '', '2017-09-15 18:26:55', '2017-09-15 21:11:47', 'ba616cc8-2b58-4656-a87b-1a3509a26012'),
 ('5', '594', 'en_us', '+ Web View', '<p>Drive traffic to your pre-loaded website. With our Auto-Fill feature, Snapchatters can send you their account email and more by just tapping.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"292\"],\"customText\":\"\",\"target\":\"\"}', '{\"type\":\"custom\",\"custom\":\"https:\\/\\/businesshelp.snapchat.com\\/en-US\\/article\\/specs-web-view\",\"entry\":\"\",\"customText\":\"View Guidelines\",\"target\":\"_blank\"}', '', '2017-09-15 18:26:55', '2017-09-15 21:11:47', '10dfec30-f80c-4fcf-b0f5-47bc5eb87e46'),
 ('6', '595', 'en_us', '+ App Install', '<p>Drive installs for your app with a swipe and a tap. Snapchatters can even install your app without leaving ours.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"292\"],\"customText\":\"\",\"target\":\"\"}', '{\"type\":\"custom\",\"custom\":\"https:\\/\\/businesshelp.snapchat.com\\/en-US\\/article\\/specs-web-view\",\"entry\":\"\",\"customText\":\"View Guidelines\",\"target\":\"_blank\"}', '', '2017-09-15 18:26:55', '2017-09-15 21:11:47', '2be1482a-3220-40c1-8a5a-c3bf94e7f827'),
 ('7', '596', 'en_us', '+ Long-Form Video', '<p>Drive views for your trailer, short film, how-to, or any other video.</p>', '{\"type\":\"entry\",\"custom\":\"\",\"entry\":[\"292\"],\"customText\":\"\",\"target\":\"\"}', '{\"type\":\"custom\",\"custom\":\"https:\\/\\/businesshelp.snapchat.com\\/en-US\\/article\\/specs-web-view\",\"entry\":\"\",\"customText\":\"View Guidelines\",\"target\":\"_blank\"}', '', '2017-09-15 18:26:55', '2017-09-15 21:11:47', '91331ce2-bae1-4dba-9ee0-b8041178fc5b');
