 ('711', 'field', '179', 'de_de', ' normal 0 primary left left 0 byebyeman asset hero the bye bye man hero 0 0 0 website 0 gray 0 0 blue 0 0 0 normal 0 primary left left 0 0 0 0 website 0 gray 0 0 the story for the january 2017 release of its new movie the bye bye man stx entertainment looked to generate awareness and watch intent among its intended audience of snapchatters age 13 to 24 and drive ticket sales for the film s opening weekend they hoped to do so with fun and interactive ad products that encouraged people to engage and share with friends blue 0 0 0 normal 0 primary left left 0 0 0 42 5m total unique snapchatters reached 177 8m total impressions 20 7% increase in ad awareness 7 9% lift in watch intent 0 website 0 gray 0 0 blue 0 0 0 normal 0 primary left left 0 the creative solution snap ads 0 0 0 website stx recut its existing trailers into bite sized fullscreen snap ads and ran them across snapchat to fill snapchatters in on the film s release date stx optimized its snap ads campaign to reach snapchatters more likely to watch movies in theaters as those who had previously interacted with stx s snapchat ads make a snap ad 0 gray 0 0 41 3m snap ads impressions blue 0 0 0 normal 0 primary the ads reached an audience of engaged moviegoers left left 0 0 0 0 website 0 gray 0 0 blue 0 0 0 normal 0 primary left left 1 the creative solution high school movie theater filters 0 0 0 website stx developed a series of filters for the weeks leading up to the movie s release as well as a short period after the filters featured the titular bye bye man as well as a reminder of when the movie would be playing in theaters to reach its intended audience stx placed its filters over high schools colleges and movie theaters in the us make a filter 0 gray 0 0 13 8m unique reach across all filters blue 0 0 0 normal 0 primary the filter reached an audience of engaged moviegoers left left 0 0 0 0 website 0 gray 0 0 blue 0 0 0 normal 0 primary left left 0 the creative solution national lens 0 0 0 website stx worked closely with snapchat to develop two different lenses that snuck the bye bye man into snapchatters snaps the lenses also included the movie s release date serving as a helpful reminder when sent to friends the lenses were available all across the us the first one a month before and the second just a couple days before the movie s launch keeping the film at the top of everyone s mind learn more about lenses 0 gray 0 0 20 5s average play time 49m lens impressions blue 0 0 0 normal 0 primary the lens snuck the bye bye man into snapchatters snaps left left 0 0 0 0 website 0 gray 0 0 blue 0 0 0 normal 0 primary left left download the bye bye man pdf download the bye bye man pdf byebyeman asset download 0 0 0 0 website 0 gray 0 0 blue 0 0 0 '),
